    false,nt"url": null,nt"notes": "NODC Accession 0115019 includes chemical,
    discrete sample, meteorological, physical, profile and underway - surface data collected
    from THOMAS G. THOMPSON in the Bismarck Sea, North Pacific Ocean and South Pacific
    Ocean from 1993-10-05 to 1993-11-10 and retrieved during cruise 3250TN026_1 and
    WOCE_P10. These data include ALKALINITY, BAROMETRIC PRESSURE, CARBON DIOXIDE - AIR,
    CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-12 (CFC-12), DELTA CARBON-13,
    DELTA CARBON-14, DELTA HELIUM-3, DISSOLVED INORGANIC CARBON, DISSOLVED OXYGEN, HELIUM,
    HYDROSTATIC PRESSURE, NEON, NITRATE, NITRITE, PHOSPHATE, Partial pressure (or fugacity)
    of carbon dioxide, Potential temperature (theta), SALINITY, SEA SURFACE TEMPERATURE,
    SILICATE, Tritium (Hydrogen isotope) and WATER TEMPERATURE. The instruments used
    to collect these data include CTD, Carbon dioxide (CO2) gas analyzer, Shower head
    chamber equilibrator for autonomous carbon dioxide (CO2) measurement and bottle.
    These data were collected by Robert M. Key of Princeton University; Department of
    Geosciences; Program in Atmospheric and Ocean Sciences and Christopher Sabine of
    US DOC; NOAA; OAR; Pacific Marine Environmental Laboratory as part of the WOCE P10
    and WOCE_P10 data set.nnThe World Ocean Circulation Experiment (WOCE) was a major
    component of the World Climate Research Program with the overall goal of better
    understanding the ocean's role in climate and climatic changes resulting from both
    natural and anthropogenic causes. The CO2 survey took advantage of the sampling
    opportunities provided by the WOCE Hydrographic Program (WHP) cruises during this
    period between 1990 and 1998. The final collection covers approximately 23,000 stations
    from 94 WOCE cruises.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
